import React from 'react';
import './App.css';

import {MDBIcon } from 'mdb-react-ui-kit';
import Navbar from './components/Navbar';
import Header from './components/Header';

function App() {
  return (
      <div className='mainbody'>
        <Navbar/>
        <Header/>
        <center><h1>For any business or promotion contact me <span><MDBIcon fas icon="envelope" /></span> ajatinpatel@gmail.com</h1></center>
      </div>
  );
}

export default App;
